import { Routes, Route } from "react-router-dom";
import App from "./App"
import Form from "./pages/"

export const AppRoutes = () => {
    return (
        <Routes>
            <Route path="/" element={<App />} />
            <Route path="/form" element={<Form />} />
        </Routes>
    )
}
